import React from "react";
import styled from "styled-components";

const Home = () => {
  return (
    <Wrapper>
      <Title>Welcome Matthew</Title>
    </Wrapper>
  );
};

const Wrapper = styled.article`
  display: flex;
  flex-direction: column;
`;
const Title = styled.h1``;

export default Home;
